import React, { Component } from 'react';

import ResponsiveDrawer from './Layout';


class IndexTutorial extends Component {
  constructor(props){
    super(props)
    this.state={
      content:[]
    }
    fetch('/api/react')
    .then(res=>res.json())
    .then(response=>this.setState({content:response}))
  }

  render() {
    return (
      <div>
      {console.log(this.state.content)}
        <ResponsiveDrawer content={this.state.content} />

      </div>
    );
  }
}

export default IndexTutorial;
